import React from "react";
import { motion } from 'framer-motion';

const containerVariants = {
  hidden: {
    opacity: 0,
  },
  visible: {
    opacity: 1,
    transition: {
      delay: 1.5,
      duration: 1.5
    }
  },
  exit: {
    x: '-100vh',
    transition: {
      ease: 'easeInOut'
    }
  }
}

const Home = () => {
  return (
    <div className="home-container">
      <motion.div className='welcome-msg'
        variants={containerVariants}
        initial='hidden'
        animate='visible'
        exit='exit'
      >
        <p className='welcome'>Welcome and thanks for stopping by! My name is Ted Neben and I am a Fullstack Software Engineer.</p>
        <div className='welcome-quote'>
          <p className='quote'><em>"All problems in computer science can be solved by another level of indrection." - David Wheeler</em></p>
          <p className='quote'><em>"But that usually will create another problem." - David Wheeler</em></p>
        </div>
      </motion.div>

    </div>
  );
};

export default Home;
